INSERT INTO news.NewsSource (description, fetchinterval, lastArticleFetchTime, lastFetchTry, `name`, rssUrl) 
	VALUES ('A lot of dreams don’t come true in this world. Mine did, I am now the editorial cartoonist for the Chicago Tribune. The Trib has a long and storied history of editorial cartooning. From John T. McCutcheon to Orr to Parrish right on through Dick Locher and Jeff MacNelly. There is no other place any cartoonist would rather draw for then right here. This blog writes a new page in that history. Here you will see my daily editorial cartoons as well as my nationally syndicated comic strip, Prickly City. I invite you to comment. I look forward to our conversation.', 30720, '2014-03-02 17:50:52.0', '2014-03-02 19:50:19.0', 'Taking a Stantis', 'http://chicagotribune.feedsportal.com/c/34253/f/622832/index.rss');
